fn_tests.input_infer:
- Ast variants: {Empty, Flags, Literal, Dot, Assertion, Class, Repetition, Group, Alternation, Concat}
- Writer types: {fmt::Formatter, &mut String}
- Valid characters for Literal: {ASCII printable characters, escape sequences}
- Valid flags for Flags: {i, s, m, x, a, d, u} (valid combinations and conflicting flags)
- Nested structures for Group, Alternation, Concat must not exceed 10 levels deep.

Test input ranges: 
Ast = {Empty, Flags, Literal (valid printable characters + escape sequences), Dot, Assertion, Class (valid character classes), Repetition (0 to unlimited times), Group (1 to 10 levels deep), Alternation (1 to 10 alternatives), Concat (1 to 10 expressions)}; W = {fmt::Formatter, &mut String}
